public MasterKey getNextKey() {
  super.readLock.lock();
  try {
    if (this.nextMasterKey == null) {
      return null;
    } else {
      return this.nextMasterKey.getMasterKey();
    }
  } finally {
    super.readLock.unlock();
  }
}
